import { Link } from "react-router-dom"

export default function Navbar(){

    return(
        <nav className="nav">

            <Link to="/" className="homeButton">
                Home Page
            </Link>

            <ul>

                    <CustomLink href="/Upcoming" className="upButton">Upcoming Events</CustomLink>
                    <CustomLink href="/Past" className="pastbutton">Past Events</CustomLink>
                    <CustomLink href="/Contact" className="contactbutton">Contact Us</CustomLink>
                    <CustomLink href="/AboutUs" className="aboutButton">About Us</CustomLink>

            </ul>

        </nav>



    )

}

function CustomLink({href, children,...props}){

    return(
        <li>
            <Link to={href} {...props}> 
            {children}
            </Link>
        </li>

    )
}
